import * as React from 'react';
import { Button, Text, View } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import {useValue} from './ValueContext';

import Lol from './addSpend'
import ProfileScreen from './Profile';
import Bio from './Bio'
import Crypto from './Crypto'


function DetailsScreen() {
  return (
    <View>
      <Text>At spending logs</Text>
    </View>
  );
}

function SpendingLogs() {
  return (
    <View>
      <Text>At spending logs</Text>
    </View>
  );
}

function AddSpend() {
  return (
    <View>
      <Lol />
    </View>
  );
}

function SeeAssets() {
  return (
    <View>
      <Text>Seeing assets</Text>
    </View>
  );
}

function SeeMarkets() {
  return (
    <View>
      <Text>Seeing markets</Text>
    </View>
  );
}

function SeeMarketSummary() {
  return (
    <View>
      <Text>Seeing market summary</Text>
    </View>
  );
}

// access the profile info from this page ...
function HomeScreen({ navigation }) {
    const {currentValue} = useValue();
  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <Button
        title="Add Spenditure"
        onPress={() => navigation.navigate('Add')}
      />
      <br></br>
      <Button
        title="Go to Logs"
        onPress={() => navigation.navigate('Logs')}
      />
    </View>
  );
}

function CryptoScreen({ navigation }) {
  const {currentValue} = useValue();
return (
  <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
    <Button
      title="Add Spenditure"
      onPress={() => navigation.navigate('Add')}
    />
    <br></br>
    <Button
      title="Go to Logs"
      onPress={() => navigation.navigate('Logs')}
    />
  </View>
);
}

function SettingsScreen({ navigation }) {
  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <Text>Settings screen</Text>
      <Button
        title="Go to Details"
        onPress={() => navigation.navigate('Details')}
      />
    </View>
  );
}

const HomeStack = createNativeStackNavigator();

function HomeStackScreen() {
  return (
    <HomeStack.Navigator>
      <HomeStack.Screen name="Page1" component={HomeScreen} 
         />
      <HomeStack.Screen name="Add" component={AddSpend} 
         />
      <HomeStack.Screen name="Logs" component={SpendingLogs} 
      />
    </HomeStack.Navigator>
  );
}

const CryptoStack = createNativeStackNavigator();

function CryptoStackScreen() {
  return (
    <CryptoStack.Navigator>
      <CryptoStack.Screen name="Crypto Check" component={CryptoScreen} 
         />
      <CryptoStack.Screen name="Add" component={AddSpend} 
         />
      <CryptoStack.Screen name="Logs" component={SpendingLogs} 
      />
    </CryptoStack.Navigator>
  );
}

const SettingsStack = createNativeStackNavigator();

function SettingsStackScreen() {
  return (
    <SettingsStack.Navigator>
      <SettingsStack.Screen name="Settings" component={SettingsScreen} 
      />
      <SettingsStack.Screen name="Details" component={DetailsScreen} 
      />

    </SettingsStack.Navigator>
  );
}

const Tab = createBottomTabNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <Tab.Navigator>
        <Tab.Screen name="Home" component={HomeStackScreen} 
          options={{
            headerShown: false
        }}/>

        <Tab.Screen name="Crypto check" component={CryptoStackScreen} 
        options={{
            headerShown: false
        }}/>
        <Tab.Screen name="Bio" component={Bio} 
        options={{
            headerShown: false
        }}/>
      </Tab.Navigator>
    </NavigationContainer>
  );
}
